📲🔴 AUTOCOLTIVAZIONE, SVOLTA DELLA CASSAZIONE
✅ ORA #LEGALIZZAZIONE!

@BenedettoDellaVedova “La svolta positiva della Cassazione sulla liceità della coltivazione domestica della #cannabis è piena di ragionevolezza. Si rompe un tabù. Ora andiamo avanti: con la legalizzazione della cannabis avremmo più sicurezza e miliardi per lo Stato sottratti alla criminalità”.

🔴 STOP ALL'EMENDAMENTO SULLA #CANNABISLIGHT🔴 "Come un dottor Azzeccagarbugli proibizionista, la Presidente Casellati ha scovato la norma del regolamento utile per soddisfare le pretese dei don Rodrigo del centro-destra, per i quali ‘l’emendamento sulla cannabis light non s’ha da fare’. Pagheranno questo fanatismo proibizionista decine di migliaia di incolpevoli lavoratori della filiera. 
In ogni caso, questo stop non impedisce in teoria alla maggioranza di approvare in tempi brevissimi la norma a partire dalle due proposte di legge che sono state presentate sul tema, una delle quali a firma di Emma Bonino".
@BenedettoDellaVedova

Giorgia #Meloni oggi se la prende con la #cannabislight. Eppure #FratellidItalia non ha disdegnato di ricevere, legittimamente e legalmente, contributi finanziari da parte di azionisti di una multinazionale americana entrata nel business della marijuana in Canada. 
Meloni combatte la sua crociata contro la legalizzazione della cannabis con i soldi di chi investe nella cannabis legale? 
@BenedettoDellaVedova
